import { LOAD_REQUEST, LOAD_SUCCESS, LOAD_FAILURE } from "./actionTypes";

export function loadRequest() {
  return {
    type: LOAD_REQUEST,
  };
}
export function loadSuccess(data) {
  return {
    type: LOAD_SUCCESS,
    payload: data,
  };
}
export function loadFailure() {
  return {
    type: LOAD_FAILURE,
  };
}
